ALTER TABLE `measurement`
    ADD CONSTRAINT `fk_station_id` FOREIGN KEY (`station_id`) REFERENCES `station` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT;

#SQL-Befehl für View-Erstellung v_measurementWithStation
CREATE VIEW v_measurementWithStation AS
SELECT measurement.id AS 'm_id', measurement.time, measurement.temperature, measurement.rain, measurement.station_id, station.id AS 's_id', station.name, station.altitude, station.location
FROM measurement
         INNER JOIN station
                    ON station.id = measurement.station_id;

